import logo from "./logo.svg";
import "./App.css";
import { useState } from "react";

function App() {
  const [recipe, setRecipe] = useState({});
  return (
    <main className="recipe">
      <form>
        <div>
          <legend className="recipe__legend">Recipe Name</legend>
          <input
            className="recipe__recipe-name"
            type="text"
            placeholder="Sourdough"
          />
        </div>
        <div className="recipe__ingredient-container">
          <input type="text" name="ingredient-name-1" />
          <input type="number" name="ingredient-percentage-1" placeholder="%" />
        </div>
      </form>
    </main>
  );
}

export default App;
